import {
  Box,
  Button,
  Dialog,
  DialogActions,
  DialogContent,
  DialogTitle,
  FormControl,
  Grid,
  InputLabel,
  MenuItem,
  Select,
  TextField,
} from '@mui/material';
import React, { useEffect, useState } from 'react';
// import { SHEETS_CONFIG } from '../../../config/sheetsConfig';

// Temporary config until sheetsConfig is created
const SHEETS_CONFIG = {
  SPREADSHEET_ID: '18B1PIhCDmBWyHZytvOcfj_1QbYBwczLf1x1Qbu0E5As',
  RANGE: 'Sheet1!A:Z'
};

interface Location {
  id: string;
  code: string;
  avatar: string;
  category: string;
  subcategory: string;
  address: string;
  status: 'active' | 'inactive';
  ward: string;
  district: string;
  province: string;
  note: string;
}

interface CreateLocationDialogProps {
  open: boolean;
  onClose: () => void;
  editing: Location | null;
  onSuccess: () => void;
}

const SHEET_ID = SHEETS_CONFIG.SPREADSHEET_ID;

const AVATAR_OPTIONS = [
  { value: 'üè¢', label: 'üè¢ T√≤a nh√†' },
  { value: 'üè™', label: 'üè™ C·ª≠a h√†ng' },
  { value: 'üè≠', label: 'üè≠ Nh√† m√°y' },
  { value: 'üè†', label: 'üè† Nh√† ·ªü' },
  { value: 'üè¢', label: 'üè¢ VƒÉn ph√≤ng' },
  { value: 'üè¨', label: 'üè¨ Trung t√¢m th∆∞∆°ng m·∫°i' },
  { value: 'üèóÔ∏è', label: 'üèóÔ∏è C√¥ng tr∆∞·ªùng' },
  { value: 'üöö', label: 'üöö Kho v·∫≠n' },
];

const CATEGORY_OPTIONS = [
  'Kho h√†ng',
  'C·ª≠a h√†ng',
  'Nh√† m√°y',
  'VƒÉn ph√≤ng',
  'Trung t√¢m th∆∞∆°ng m·∫°i',
  'C√¥ng tr∆∞·ªùng',
  'Kho v·∫≠n',
  'Kh√°c',
];

const PROVINCE_OPTIONS = ['TP. H·ªì Ch√≠ Minh', 'H√† N·ªôi', 'ƒê√† N·∫µng', 'C·∫ßn Th∆°', 'H·∫£i Ph√≤ng', 'Kh√°c'];

const CreateLocationDialog: React.FC<CreateLocationDialogProps> = ({
  open,
  onClose,
  editing,
  onSuccess,
}) => {
  const [formData, setFormData] = useState<Partial<Location>>({
    code: '',
    avatar: 'üè¢',
    category: '',
    subcategory: '',
    address: '',
    status: 'active',
    ward: '',
    district: '',
    province: 'TP. H·ªì Ch√≠ Minh',
    note: '',
  });
  const [loading, setLoading] = useState(false);

  useEffect(() => {
    if (editing) {
      setFormData(editing);
    } else {
      setFormData({
        code: '',
        avatar: 'üè¢',
        category: '',
        subcategory: '',
        address: '',
        status: 'active',
        ward: '',
        district: '',
        province: 'TP. H·ªì Ch√≠ Minh',
        note: '',
      });
    }
  }, [editing, open]);

  const handleSubmit = async () => {
    if (!formData.code?.trim()) {
      alert('Vui l√≤ng nh·∫≠p m√£ ƒë·ªãa ƒëi·ªÉm');
      return;
    }

    setLoading(true);
    try {
      const url = editing
        ? `/api/locations/${editing.id}?spreadsheetId=${encodeURIComponent(SHEET_ID)}`
        : `/api/locations?spreadsheetId=${encodeURIComponent(SHEET_ID)}`;

      const method = editing ? 'PUT' : 'POST';

      const response = await fetch(url, {
        method,
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });

      if (response.ok) {
        onSuccess();
        onClose();
      } else {
        const error = await response.json();
        alert(`L·ªói: ${error.error || 'Kh√¥ng th·ªÉ l∆∞u ƒë·ªãa ƒëi·ªÉm'}`);
      }
    } catch (error) {
      console.error('L·ªói l∆∞u ƒë·ªãa ƒëi·ªÉm:', error);
      alert('L·ªói k·∫øt n·ªëi server');
    } finally {
      setLoading(false);
    }
  };

  const handleChange = (field: keyof Location, value: string) => {
    setFormData((prev) => ({ ...prev, [field]: value }));
  };

  return (
    <Dialog open={open} onClose={onClose} maxWidth="md" fullWidth>
      <DialogTitle>{editing ? 'S·ª≠a ƒë·ªãa ƒëi·ªÉm' : 'Th√™m ƒë·ªãa ƒëi·ªÉm m·ªõi'}</DialogTitle>
      <DialogContent>
        <Box sx={{ pt: 2 }}>
          <Grid container spacing={2}>
            <Grid size={{ xs: 12, sm: 6 }}>
              <TextField
                fullWidth
                label="M√£ ƒë·ªãa ƒëi·ªÉm *"
                value={formData.code || ''}
                onChange={(e) => handleChange('code', e.target.value)}
                required
              />
            </Grid>
            <Grid size={{ xs: 12, sm: 6 }}>
              <FormControl fullWidth>
                <InputLabel>Avatar</InputLabel>
                <Select
                  value={formData.avatar || 'üè¢'}
                  onChange={(e) => handleChange('avatar', e.target.value)}
                  label="Avatar"
                >
                  {AVATAR_OPTIONS.map((option) => (
                    <MenuItem key={option.value} value={option.value}>
                      {option.label}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
            <Grid size={{ xs: 12, sm: 6 }}>
              <FormControl fullWidth>
                <InputLabel>Danh m·ª•c</InputLabel>
                <Select
                  value={formData.category || ''}
                  onChange={(e) => handleChange('category', e.target.value)}
                  label="Danh m·ª•c"
                >
                  {CATEGORY_OPTIONS.map((category) => (
                    <MenuItem key={category} value={category}>
                      {category}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </Grid>
            <Grid size={{ xs: 12, sm: 6 }}>
              <TextField
                fullWidth
                label="H·∫°ng m·ª•c"
                value={formData.subcategory || ''}
                onChange={(e) => handleChange('subcategory', e.target.value)}
              />
            </Grid>
            <Grid size={12}>
              <TextField
                fullWidth
                label="ƒê·ªãa ch·ªâ"
                value={formData.address || ''}
                onChange={(e) => handleChange('address', e.target.value)}
                multiline
                rows={2}
              />
            </Grid>
            <Grid size={{ xs: 12, sm: 4 }}>
              <TextField
                fullWidth
                label="Ph∆∞·ªùng/X√£"
                value={formData.ward || ''}
                onChange={(e) => handleChange('ward', e.target.value)}
              />
            </Grid>
            <Grid size={{ xs: 12, sm: 4 }}>
              <TextField
                fullWidth
                label="Qu·∫≠n/Huy·ªán"
                value={formData.district || ''}
                onChange={(e) => handleChange('district', e.target.value)}
              />
            </Grid>
            <Grid size={{ xs: 12, sm: 4 }}>
              <FormControl fullWidth>
